var __index = {"config":{"lang":["ru"],"separator":"[\\s\\-]+","pipeline":["stopWordFilter"]},"docs":[{"location":"index.html","title":"\u0410\u043b\u0433\u043e\u0433\u043e\u043b\u0438\u0437\u043c","text":"<p>\u0420\u0435\u0441\u0443\u0440\u0441-\u0431\u043b\u043e\u0433-\u0437\u0430\u043c\u0435\u0442\u043a\u0430-\u0431\u043e\u0433\u0437\u043d\u0430\u0435\u0442\u0447\u0442\u043e\u0435\u0449\u0451, \u043f\u043e\u0441\u0432\u044f\u0449\u0451\u043d\u043d\u044b\u0439 \u0438\u0437\u0443\u0447\u0435\u043d\u0438\u044e \u0430\u043b\u0433\u043e\u0440\u0438\u0442\u043c\u043e\u0432 \u0438 \u0441\u0442\u0440\u0443\u043a\u0442\u0443\u0440 \u0434\u0430\u043d\u043d\u044b\u0445 (\u043d\u0443 \u0438 \u043f\u0440\u043e\u0447\u0438\u0445 \u0437\u0430\u0443\u043c\u043d\u044b\u0445 \u0448\u0442\u0443\u0447\u0435\u043a)</p>"},{"location":"index.html#_2","title":"\u041f\u0440\u0435\u0430\u043c\u0431\u0443\u043b\u0430","text":"<p>\u042f \u0438\u043d\u0442\u0435\u0440\u0435\u0441\u0443\u044e\u0441\u044c \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u0435\u043c \u0443\u0436\u0435 \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u043b\u0435\u0442, \u0434\u0430\u0436\u0435 \u043e\u0431\u0437\u0430\u0432\u0451\u043b\u0441\u044f \u043d\u0435\u0431\u043e\u043b\u044c\u0448\u0438\u043c \u043e\u043f\u044b\u0442\u043e\u043c \u0438 \u0440\u0430\u0431\u043e\u0442\u043e\u0439, \u043d\u043e \u043c\u0435\u043d\u044f \u043d\u0435 \u043e\u0441\u0442\u0430\u0432\u043b\u044f\u0435\u0442 \u0447\u0443\u0432\u0441\u0442\u0432\u043e, \u0447\u0442\u043e \u044f \u0434\u0432\u0438\u0433\u0430\u044e\u0441\u044c \u043d\u0435 \u0432 \u0442\u043e\u043c \u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0438. \u041f\u043e\u044d\u0442\u043e\u043c\u0443 \u0440\u0435\u0448\u0438\u043b \u0432\u0437\u044f\u0442\u044c\u0441\u044f \u0437\u0430 \u0433\u043e\u043b\u043e\u0432\u0443 \u0438 \u043d\u0430\u0447\u0430\u0442\u044c \u0443\u0447\u0438\u0442\u044c \u0430\u043b\u0433\u043e\u0440\u0438\u0442\u043c\u044b \u0438 \u0441\u0442\u0440\u0443\u043a\u0442\u0443\u0440\u044b \u0434\u0430\u043d\u043d\u044b\u0445. \u0421\u0438\u0435 \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u0435 \u0432\u043e\u0441\u043f\u0430\u043b\u0451\u043d\u043d\u043e\u0433\u043e \u043c\u043e\u0437\u0433\u0430 \u043d\u0443\u0436\u043d\u043e \u0431\u043e\u043b\u044c\u0448\u0435 \u0434\u043b\u044f \u043c\u0435\u043d\u044f \u0441\u0430\u043c\u043e\u0433\u043e, \u043d\u043e \u0435\u0441\u043b\u0438 \u0432\u044b \u044d\u0442\u043e \u0447\u0438\u0442\u0430\u0435\u0442\u0435 \u0438 \u043d\u0435 \u0441\u0447\u0438\u0442\u0430\u0435\u0442\u0435 \u0431\u0440\u0435\u0434\u043e\u043c \u0441\u0443\u043c\u0430\u0441\u0448\u0435\u0434\u0448\u0435\u0433\u043e, \u0442\u043e \u044f \u043f\u0440\u0435\u0434\u0435\u043b\u044c\u043d\u043e \u0440\u0430\u0434 (\u0447\u0442\u043e \u043c\u043e\u0433\u0443 \u043a\u0430\u0437\u0430\u0442\u044c\u0441\u044f \u0430\u0434\u0435\u043a\u0432\u0430\u0442\u043d\u044b\u043c).</p>"},{"location":"index.html#_3","title":"\u041f\u043b\u0430\u043d \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f (\u043d\u0430\u0434\u0451\u0436\u043d\u044b\u0439 \u043a\u0430\u043a [ \u0414\u0410\u041d\u041d\u042b\u0415 \u0423\u0414\u0410\u041b\u0415\u041d\u042b ] \u0447\u0430\u0441\u044b)","text":"<p>\u041a\u0430\u0436\u0434\u044b\u0439 \u0434\u0435\u043d\u044c \u0438\u0437\u0443\u0447\u0430\u0442\u044c \u043e\u0434\u043d\u0443 \u043d\u043e\u0432\u0443\u044e \u0432\u0435\u0449\u044c/\u0440\u0435\u0448\u0430\u0442\u044c \u043d\u043e\u0432\u0443\u044e \u0437\u0430\u0434\u0430\u0447\u0443. \u0412 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u043d\u0435\u0431\u043e\u043b\u044c\u0448\u043e\u0433\u043e \u0443\u0441\u043b\u043e\u0436\u043d\u0435\u043d\u0438\u044f - \u044f \u043f\u043e\u0441\u0442\u0430\u0440\u0430\u044e\u0441\u044c \u0440\u0435\u0448\u0430\u0442\u044c \u0437\u0430\u0434\u0430\u0447\u0438 \u043d\u0430 \u0434\u0432\u0443\u0445 \u044f\u0437\u044b\u043a\u0430\u0445 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u044f: Python \u0438 Rust. Python - \u043c\u043e\u0439 \u043f\u0435\u0440\u0432\u044b\u0439 \u044f\u0437\u044b\u043a \u0438, \u043a \u0441\u043e\u0436\u0430\u043b\u0435\u043d\u0438\u044e, \u0435\u0434\u0438\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445 \u043d\u043e\u0440\u043c\u0430\u043b\u044c\u043d\u043e \u0438\u0437\u0443\u0447\u0435\u043d\u043d\u044b\u0439. \u041d\u043e \u0435\u0433\u043e \u0445\u0432\u0430\u0442\u0430\u0435\u0442: \u043e\u043d \u0438 \u0434\u043b\u044f \u0441\u043a\u0440\u0438\u043f\u0442\u043e\u0432, \u0438 \u0431\u044d\u043a\u0430, \u0438 ML \u0438 \u0447\u0435\u0433\u043e \u0442\u043e\u043a \u0435\u0449\u0451 \u043d\u0435 \u043f\u043e\u0434\u0445\u043e\u0434\u0438\u0442. \u041d\u043e \u044f \u0445\u043e\u0447\u0443 \u0438\u0437\u0443\u0447\u0438\u0442\u044c \u043f\u0440\u0438\u043d\u0446\u0438\u043f\u0438\u0430\u043b\u044c\u043d\u043e \u043d\u043e\u0432\u044b\u0439 \u0434\u043b\u044f \u043c\u0435\u043d\u044f \u0438\u043d\u0441\u0442\u0440\u0443\u043c\u0435\u043d\u0442 - Rust. \u041e\u043d \u0431\u0443\u0434\u0442\u043e \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043f\u043e\u043b\u043d\u043e\u0439 \u043f\u0440\u043e\u0442\u0438\u0432\u043e\u043f\u043e\u043b\u043e\u0436\u043d\u043e\u0441\u0442\u044c\u044e Python - \u043a\u043e\u043c\u043f\u0438\u043b\u0438\u0440\u0443\u0435\u043c\u044b\u0439, \u0441\u043e \u0441\u0442\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0442\u0438\u043f\u0438\u0437\u0430\u0446\u0438\u0435\u0439, \u0438\u043c\u0435\u0435\u0442 \u0442\u0440\u0443\u0434\u043d\u044b\u0439 \u0434\u043b\u044f \u0447\u0442\u0435\u043d\u0438\u044f \u0441\u0438\u043d\u0442\u0430\u043a\u0441\u0438\u0441 (\u043d\u0435 \u0441\u043e\u0432\u0441\u0435\u043c, \u043d\u043e \u0432\u0441\u0451 \u0436\u0435), \u0435\u0433\u043e \u043d\u0435 \u043b\u044e\u0431\u0438\u0442 \u0431\u0438\u0437\u043d\u0435\u0441 (\u043d\u043e \u044d\u0442\u043e \u043f\u043e\u043a\u0430).</p>"},{"location":"data_structures/linked_lists/linked_lists.html","title":"\u0421\u0432\u044f\u0437\u043d\u044b\u0435 \u0441\u043f\u0438\u0441\u043a\u0438","text":"<p>\u0421\u0432\u044f\u0437\u043d\u044b\u0435 \u0441\u043f\u0438\u0441\u043a\u0438 - \u0431\u0430\u0437\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u0430\u044f, \u043f\u0435\u0440\u0432\u0430\u044f \u0434\u0438\u043d\u0430\u043c\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0441\u0442\u0440\u0443\u043a\u0442\u0443\u0440\u0430 \u0434\u0430\u043d\u043d\u044b\u0445, \u0441 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u043d\u0430\u0447\u0438\u043d\u0430\u044e\u0442 \u0437\u043d\u0430\u043a\u043e\u043c\u0438\u0442\u044c\u0441\u044f \u043f\u0440\u0438 \u0438\u0437\u0443\u0447\u0435\u043d\u0438\u0438 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u044f. \u0421\u0443\u0449\u043d\u043e\u0441\u0442\u044c \u0434\u0430\u043d\u043d\u043e\u0439 \u0441\u0442\u0440\u0443\u043a\u0442\u0443\u0440\u044b \u0437\u0430\u043a\u043b\u044e\u0447\u0430\u0435\u0442\u0441\u044f \u0432 \u0442\u043e\u043c, \u0447\u0442\u043e \u043e\u043d\u0430 \u0441\u043e\u0441\u0442\u043e\u0438\u0442 \u0438\u0437 \u043d\u0435\u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u0430 \u0441\u0432\u044f\u0437\u043d\u044b\u0445 \u0443\u0437\u043b\u043e\u0432 (\u043d\u043e\u0434). \u041d\u0443 \u0430 \u043a\u0430\u0436\u0434\u0430\u044f \u044d\u0442\u0430 \u0432\u0430\u0448\u0430 \u043d\u043e\u0434\u0430, \u0432 \u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u0438 \u043e\u0442 \u0432\u0438\u0434\u0430 \u0441\u0442\u0440\u0443\u043a\u0442\u0443\u0440\u044b, \u0432\u043a\u043b\u044e\u0447\u0430\u0435\u0442 \u0432 \u0441\u0435\u0431\u044f \u043a\u0430\u043a\u0438\u0435-\u0442\u043e \u0434\u0430\u043d\u043d\u044b\u0435 \u0438 \u0441\u0441\u044b\u043b\u043a\u0443/\u0441\u0441\u044b\u043b\u043a\u0438 \u043d\u0430 \u0434\u0440\u0443\u0433\u0438\u0435 \u0443\u0437\u043b\u044b.</p>"},{"location":"data_structures/linked_lists/linked_lists.html#_2","title":"\u0412\u0438\u0434\u044b \u0441\u0432\u044f\u0437\u043d\u044b\u0445 \u0441\u043f\u0438\u0441\u043a\u043e\u0432","text":"<p>\u042d\u0442\u0430 \u0441\u0443\u0449\u043d\u043e\u0441\u0442\u044c \u043c\u043e\u0436\u0435\u0442 \u0431\u044b\u0442\u044c \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0430 \u0432 \u0434\u0432\u0443\u0445 \u043a\u043b\u0430\u0441\u0441\u0438\u0444\u0438\u043a\u0430\u0446\u0438\u044f\u0445:</p> <ul> <li>\u041f\u043e \u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u0443 \u0443\u043a\u0430\u0437\u0430\u0442\u0435\u043b\u0435\u0439 (\u043d\u0430 \u043e\u0434\u043d\u0443 \u043d\u043e\u0434\u0443)</li> <li>\u041f\u043e \u0441\u043f\u043e\u0441\u043e\u0431\u0443 \u0441\u0432\u0437\u044f\u0437\u0438 \u044d\u0442\u0438\u0445 \u0441\u0430\u043c\u044b\u0445 \u0443\u0437\u043b\u043e\u0432</li> </ul> <p>\u041f\u0435\u0440\u0432\u0430\u044f \u043a\u043b\u0430\u0441\u0441\u0438\u0444\u0438\u043a\u0430\u0446\u0438\u044f \u0434\u0435\u043b\u0438\u0442 (bring out the knive to cut and divide!) \u0441\u043f\u0438\u0441\u043a\u0438 \u043d\u0430:</p> <ul> <li>\u041e\u0434\u043d\u043e\u0441\u0432\u044f\u0437\u043d\u044b\u0435: \u043a\u0430\u0436\u0434\u044b\u0439 \u0443\u0437\u0435\u043b \u0445\u0440\u0430\u043d\u0438\u0442 \u0434\u0430\u043d\u043d\u044b\u0435 \u0438 \u0441\u0441\u044b\u043b\u043a\u0443 \u043d\u0430 \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0443\u044e \u043d\u043e\u0434\u0443, \u043a\u0440\u0447 \u0442\u0438\u043f\u0430 \u0442\u0430\u043a\u043e\u0433\u043e:</li> </ul> <p></p> <ul> <li>\u0414\u0432\u0443\u0441\u0432\u044f\u0437\u043d\u044b\u0435: \u043f\u043e\u0447\u0442\u0438 \u0442\u043e \u0436\u0435 \u0441\u0430\u043c\u043e\u0435, \u043d\u043e \u0442\u0443\u0442 \u043d\u043e\u0434\u044b \u043f\u043e\u043c\u043d\u044f\u0442 \u043f\u0440\u043e \u0441\u0432\u043e\u0438 \u043a\u043e\u0440\u043d\u0438 (\u043f\u043e\u0445\u0432\u0430\u043b\u044c\u043d\u043e):</li> </ul> <p></p> <p>\u041d\u041e \u0418 \u042d\u0422\u041e \u0415\u0429\u0401 \u041d\u0415 \u0412\u0421\u0401!</p> <p>\u041f\u041e\u041a\u0423\u041f\u0410\u042f \u041e\u0414\u041d\u0423 \u041a\u041b\u0410\u0421\u0421\u0418\u0424\u0418\u041a\u0410\u0426\u0418\u042e \u0421\u0412\u042f\u0417\u041d\u042b\u0425 \u0421\u041f\u0418\u0421\u041a\u041e\u0412 - \u041c\u042b \u0414\u0410\u0420\u0418\u041c \u0412\u0422\u041e\u0420\u0423\u042e!</p> <p>\u0414\u043e \u044d\u0442\u043e\u0433\u043e \u043c\u044b \u0440\u0430\u0441\u0441\u043c\u0430\u0442\u0440\u0438\u0432\u0430\u043b\u0438 \u043b\u0438\u043d\u0435\u0439\u043d\u044b\u0435 \u0441\u043f\u0438\u0441\u043a\u0438. \u0410 \u0427\u0422\u041e \u0415\u0421\u041b\u0418 \u0437\u0430\u043c\u043a\u043d\u0443\u0442\u044c \u043a\u043e\u043d\u0435\u0447\u043d\u044b\u0443\u044e \u043d\u043e\u0434\u0443 \u043d\u0430 \u043f\u0435\u0440\u0432\u0443\u044e, \u0430 \u043f\u0435\u0440\u0432\u0443\u044e \u043d\u0430 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u044e\u044e? \u041f\u043e\u043b\u0443\u0447\u0438\u043c \u0446\u0438\u043a\u043b\u0438\u0447\u043d\u044b\u0439 \u0441\u0432\u044f\u0437\u043d\u044b\u0439 \u0441\u043f\u0438\u0441\u043e\u043a:</p> <p></p>"},{"location":"data_structures/linked_lists/linked_lists.html#_3","title":"\u0410 \u0437\u0430\u0447\u0435\u043c?","text":"<p>\u041e\u043d \u043d\u0430\u043c \u0438 \u0434\u0430\u0440\u043e\u043c \u043d\u0435 \u043d\u0443\u0436\u043e\u043d, \u0441\u0432\u044f\u0437\u043d\u044b\u0439 \u0441\u043f\u0438\u0441\u043e\u043a \u0432\u0430\u0448!</p> <p>\u041d\u0430 \u0441\u0430\u043c\u043e\u043c \u0434\u0435\u043b\u0435 \u0434\u0430\u0436\u0435 \u0443 \u0441\u0432\u044f\u0437\u043d\u044b\u0445 \u0441\u043f\u0438\u0441\u043a\u043e\u0432 \u0435\u0441\u0442\u044c \u043e\u0431\u043b\u0430\u0441\u0442\u044c \u043f\u0440\u0438\u043c\u0435\u043d\u0435\u043d\u0438\u044f <code>0_0</code> . \u041d\u0430\u043f\u0440\u0438\u043c\u0435\u0440, \u0434\u043b\u044f \u0440\u0435\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u0438 \u0434\u0440\u0443\u0433\u0438\u0445 \u0441\u0442\u0440\u0443\u043a\u0442\u0443\u0440, \u0442\u0438\u043f\u0430 <code>\u043e\u0447\u0435\u0440\u0435\u0434\u0438</code> \u0438 <code>\u0441\u0442\u0435\u043a\u0430</code>, \u0430 \u0442\u0430\u043a\u0436\u0435 \u0434\u043b\u044f \u0440\u0435\u0430\u043b\u0438\u0437\u0430\u0446\u0438\u0438 \u0430\u043b\u0433\u043e\u0440\u0438\u0442\u043c\u043e\u0432 \u0441\u043e\u0440\u0442\u0438\u0440\u043e\u0432\u043a\u0438 \u0438 \u043f\u043e\u0438\u0441\u043a\u0430.</p>"},{"location":"data_structures/linked_lists/singly_linked_lists.html","title":"\u041e\u0434\u043d\u043e\u0441\u0432\u044f\u0437\u043d\u044b\u0435 \u0441\u043f\u0438\u0441\u043a\u0438","text":""}]}